CREATE TABLE IF NOT EXISTS "task_app_department" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "name" varchar(50) NOT NULL, "manager_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "task_app_userprofile" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "category" varchar(50) NOT NULL, "department_id" bigint NULL REFERENCES "task_app_department" ("id") DEFERRABLE INITIALLY DEFERRED, "reports_to_id" bigint NULL REFERENCES "task_app_userprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "task_app_task" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "task_id" varchar(15) NOT NULL UNIQUE, "deadline" date NOT NULL, "assigned_by_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "assigned_to_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "department_id" bigint NULL REFERENCES "task_app_department" ("id") DEFERRABLE INITIALLY DEFERRED, "attach_file" varchar(100) NULL, "request_details" text NULL, "priority" varchar(10) NOT NULL, "subject" varchar(255) NOT NULL, "assigned_date" datetime NOT NULL, "status" varchar(20) NOT NULL, "ticket_type" varchar(100) NOT NULL, "comments_by_assignee" text NULL, "revised_completion_date" date NULL);
CREATE TABLE IF NOT EXISTS "task_app_activitylog" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "action" varchar(50) NOT NULL, "timestamp" datetime NOT NULL, "description" text NOT NULL, "task_id" bigint NOT NULL REFERENCES "task_app_task" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
